  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of a
  modeling workshop concerning development of the Beluga coal resource in Alaska.
  The workshop was facilitated by the AEA Group of the U.S. Fish and Wildlife Service
  and attended by approximately 35 invited participants representing private industry,
  government agencies, Native peoples, and private interest groups. During the workshop,
  participants completed a series of structured exercises designed to identify major
  system components and their interactions. Discussions focusing on these interrelationships
  were used as a means of identifying areas where additional information, communication,
  and understanding are necessary.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
